import { useEffect, useState } from 'react'
import axios from "axios";

function Users() {


    const [users, setUsers] = useState([]);
    useEffect(() => {
        axios('https://jsonplaceholder.typicode.com/users')
            .then(res => setUsers(res.data))
    }, [])
    return <h2>Users</h2>;
}


export default Users
